import React from 'react';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';
import Autocomplete from '@material-ui/lab/Autocomplete';
import Container from '@material-ui/core/Container';

export default function AddAccountTemplate(props) {
  const { city } = props;
  const [identity, setIdentity] = React.useState({
    firstName: "",
    lastName: "",
    email: "",
    registrationNumber: "",
    cities: null,
    password: null,
  });
  const handleChangeIdentity = ( event) => {
    if(event.target.name === "firstName") {
      identity.firstName = event.target.value;
    } else if(event.target.name === "lastName") {
      identity.lastName = event.target.value;
    }else if(event.target.name === "email"){
      identity.email= event.target.value;
    }else if (event.target.name === "registrationNumber"){
      identity.registrationNumber = event.target.value;
    }else if (event.target.name === "password"){
      identity.password = event.target.value;
    }
    setIdentity(identity);
  };
  const handleChangeCities =(event, value, reason) => {
    identity.cities = value;
    setIdentity(identity);

  }
  console.warn("identity", identity)
  return (
    <React.Fragment>
      <Container maxWidth="xl">
      <Typography variant="subtitle1" gutterBottom>
        Informations personnelles
        </Typography>
        <Grid container spacing={3}>
          <Grid item xs={12} sm={6}>
            <TextField
              required
              id="firstName"
              name="firstName"
              label="PrÃ©nom"
              fullWidth
              variant="outlined"
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              required
              id="lastName"
              name="lastName"
              label="Nom"
              fullWidth
              variant="outlined"
            />
          </Grid>
          <Grid item xs={12}>
            <TextField
              required
              id="email"
              name="email"
              label="Email"
              variant="outlined"
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              required
              id="password"
              name="password"
              label="Mot de passe"
              fullWidth
              variant="outlined"
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField id="confirmPassword" name="confirmPassword" label="confirme ton mot de passe" variant="outlined"fullWidth />
          </Grid>
          <Grid item xs={12} >
            <Autocomplete
              multiple
              id="cities"
              name="cities"
              options={city}
              getOptionLabel={(option) => option.name}
              onChange={(event, value, reason)=>{handleChangeCities(event, value, reason)}}
              renderInput={(params) => (
                <TextField
                  {...params}
                  variant="outlined"
                  label="Villes"
                />
              )}
            />
          </Grid>
        </Grid>
      </Container>
    </React.Fragment>
  );
}
